window.bookSummaryJSON = "<p><b><i>Passion never dies, and love cannot be contained.</i></b></p> <p>Dawn woke up drowning, inside a tank in a laboratory straight out of a science fiction movie. Blinded by amnesia, she has no choice but to trust in the alluring stranger who pulls her out of the tank, but Jake Maxwell knows more than he cares to admit. Now Redeo Biotech, the company responsible for Dawn's resurrection, is hunting them both. </p> <p>As their passion for each other blossoms, Jake and Dawn must outwit their enemies and rediscover their past lives. But when their greatest foe rises from the ashes of ancient Egypt to destroy their future, only Jake and Dawn's eternal connection has the power to save them. </p> <p><b>This collection includes the novellas </b><b><i>Reborn to Die</i></b><b>, </b><b><i>Reborn to Burn</i></b><b>, the award-winning </b><b><i>Reborn to Avenge</i></b><b>, and </b><b><i>Reborn to Conquer</i></b><b>.</b></p>"; 
